export const getUserKey = () => {
 
  if (process.env.NODE_ENV === "development") {
    return process.env.REACT_APP_API_KEY ?? "DEMO_KEY";
  }
  
  let userKey: string | null = null;

  try {
    userKey = localStorage.getItem("API_KEY");
  } catch {
    return "DEMO_KEY";
  }

  return userKey ?? "DEMO_KEY";
};
